const HomeStyle = {
	container: {
		//transparent background with no border
		backgroundColor: "transparent",
		border: "none",
		//positioned relative to the normal flow
		position: "relative",
		//pushed down by the height of the navbar
		top: "10vh",
		//full width
		width: "100%",
		//height of 90vh
		height: "90vh",
		//no padding, no margin
		padding: "0",
		margin: "0",
		//no shadow
		boxShadow: "none",
		//no z-index
		zIndex: "0",
		//row
		display: "flex",
		flexDirection: "row",
	 },
	text: {
		fontWeight: "bold",
		textAlign: "center",
		color: "#FFFFFF",
		marginTop: "50vh",
		marginBottom: "50vh",
		marginLeft: "auto",
		marginRight: "auto",
		fontFamily: "sans-serif",
	}
}

export default HomeStyle
